import logo from './logo.svg';
import './App.css';

import { todos } from './todos.json';
import { computeHeadingLevel } from '@testing-library/react';
import { Component } from 'react';
 


class App extends Component {
  constructor() {
    super();
    this.state = {
      todos
    }
  }
  
  
}

export default App;
